class Solution(object):
    def markUncovered(self, i, j):
        
        stack = []
        stack.append((i,j))

        while len(stack):
            i,j = stack.pop()

            if i >= self.r or i < 0 or j >= self.c or j < 0:
                continue

            if self.board[i][j] == 'X' or self.board[i][j] == 'U':
                continue 

            self.board[i][j] = 'U'

            stack.append((i+1, j))
            stack.append((i-1, j))
            stack.append((i, j+1))
            stack.append( (i, j-1))

    def solve(self, board):
        """
        :type board: List[List[str]]
        :rtype: void Do not return anything, modify board in-place instead.
        """
        
        self.r = len(board)
        if self.r ==  0:
            return
        self.c = len(board[0])

        self.board = board

        for i in range(self.r):
            self.markUncovered(i, 0)
            self.markUncovered(i, self.c-1)

        for i in range(self.c):
            self.markUncovered(0, i)
            self.markUncovered(self.r-1, i)

        for i in range(self.r):
            for j in range(self.c):
                if self.board[i][j] == 'O':
                    self.board[i][j] = 'X'
                elif self.board[i][j] == 'U':
                    self.board[i][j] = 'O'

        return


